import React, {Component} from 'react';

class Container extends Component {
    render(){
        return(
            <div>
                <ul>
                    <li>타임라인</li>
                    <li>로그인</li>
                    <li>친구추가</li>
                </ul>
            </div>
        );
    }
}

export default Container;
